import React, { useState } from 'react';
import axios from 'axios';
import { Button, Container, TextField, Typography, Grid } from '@mui/material';

function DoctorHome() {

  const [date, setDate] = useState('');
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');
  const [message, setMessage] = useState('');
  const { id } = JSON.parse(sessionStorage.getItem("user"));

  const handleSetAvailability = () => {
    const payload = {
      doctorId: id,
      date: date,
      startTime: startTime,
      endTime: endTime
    };

    axios.post('http://localhost:5000/api/v3/setAvailability', payload)
      .then(response => {
        setMessage(response.data.message);
      })
      .catch(error => {
        console.error('Error setting availability:', error);
        setMessage('Error setting availability');
      });
  };

  return (
    <Container maxWidth="sm">
      <Typography variant="h4" gutterBottom>
        Set Doctor Availability
      </Typography>

      <Grid container spacing={2}>
        <Grid item xs={12} sm={4}>
          <TextField
            label="Date"
            type="date"
            variant="outlined"
            fullWidth
            value={date}
            onChange={(e) => setDate(e.target.value)}
            margin="normal"
          />
        </Grid>
        <Grid item xs={12} sm={4}>
          <TextField
            label="Start Time"
            type="time"
            variant="outlined"
            fullWidth
            value={startTime}
            onChange={(e) => setStartTime(e.target.value)}
            margin="normal"
          />
        </Grid>
        <Grid item xs={12} sm={4}>
          <TextField
            label="End Time"
            type="time"
            variant="outlined"
            fullWidth
            value={endTime}
            onChange={(e) => setEndTime(e.target.value)}
            margin="normal"
          />
        </Grid>
      </Grid>
      
      <Button variant="contained" color="primary" cla onClick={handleSetAvailability}>
        Set Availability
      </Button>
      <Typography color={message.startsWith('Error') ? 'error' : 'success'}>{message}</Typography>
    </Container>
  );
}

export default DoctorHome;
